import React from 'react'
import { Link } from 'react-router-dom';
import { AppBar, Avatar, Button, Toolbar, Typography, CardActions } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';

import useStyles from './styles';
import motor from '../../images/motor.jpeg';

const Navbar = () => {
    const classes = useStyles();

    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to="/" className={classes.heading} variant="h2" align="center">NYohaKa</Typography>
                <img className={classes.image} src={motor} alt="NYohaka" height="60" />
                <div className={classes.brandContainer}>
                    <CardActions className={classes.cardActions} >
                        <Button size="medium" color="primary" >
                            <EditIcon fontSize="small" />
                            Home
                        </Button>
                        <Button size="medium" color="secondary" >
                            <DeleteIcon fontSize="small" />
                            List-Pelanggan
                        </Button>
                        <Button size="medium" color="secondary" >
                            <DeleteIcon fontSize="small" />
                            Data Pegawai
                        </Button>
                    </CardActions>
                </div>
            </div>

            <Toolbar className={classes.toolbar}>
                {user ? (
                    <div className={classes.profile}>
                        <Avatar className={classes.purple} alt={user.result.name} src={user.result.imageUrl}>
                            {user.result.name.charAt(0)}
                        </Avatar>
                        <Typography className={classes.userName} variant="h6">{user.result.name}</Typography>
                        <Button variant="contained" className={classes.logout} color="secondary">Logout</Button>
                    </div>
                ) : (
                    <Button component={Link} to="/auth" variant="contained" color="primary">Sign In</Button>
                )}
            </Toolbar>
        </AppBar>
    )
}

export default Navbar
